import { Form } from "react-router-dom";
import { useState } from 'react';
import { useEffect } from 'react';
import React, { Component } from 'react'
import { TiDelete } from "react-icons/ti";


function List() {
    const [data, setData] = useState([]);
    const [id, setId] = useState("");

  

    useEffect(() => {
        fetch('https://localhost:7205/api/Client')
          
            .then(response => response.json())
            .then(json => setData(json))
            .catch(console.error);
    }, []);
    

    const handleDeleteData = () => {

        const data = {
            id : id
        }
        const optionsDelete = {
        
            method: 'DELETE',
            headers: {
            'Content-Type': 'application/json',
            },
        };
        fetch('https://localhost:7205/api/Client', optionsDelete)
            .then(response => {
                if (response.ok) {
                // Успешное удаление данных
                console.log('Данные успешно удалены');
                } else {
                // Обработка ошибки, если требуется
                console.log('Ошибка при удалении данных');
                }
            })
            .catch(error => {
                // Обработка ошибки, если требуется
                console.log('Ошибка при удалении данных:', error);
            });
    };
    
    return (
        <div>
            {data.map(post => 
                <div>
                    {post.name}, {post.phone_number} 
                    <TiDelete className='styleIcons' onClick={handleDeleteData}> 
                        value = {id}

                    </TiDelete>
                </div>
                )}
        </div>
    );
}

export default List
